import styled from "@emotion/styled";
import { Box } from "@mui/material";

const ContentContainer = styled(Box)`
  .background {
  }
  .ImagephoneWrapper {
    padding-top: 20px;
    justify-content: center;
    display: flex;
  }
  .mediaBox {
    display: flex;
    margin: auto;
    justify-content: center;
    max-width: 1440px;
  }
  .boxfooter {
    padding: 20px;
  }
  .backgroundbox {
    background-color: ghostwhite;

  }
`;

export default ContentContainer;
